    <Stack direction="horizontal" gap={2}>
    <div className="">
      <h2>Stokestakes</h2>
      <p>. <Link>Learn more</Link> </p>
    </div>
    
    <div className="bg-light border ms-auto"><Button variant="secondary">Add new </Button></div>
  </Stack>
  )
}

